package main

import (
	"fmt"
	"github.com/hashgraph/hedera-state-proof-verifier-go/stateproof"
)

// this example verifies a V5 record stream of both the original and executed scheduled transaction
func main() {
	original := []byte(
		`{
			    "address_books": [
			        ""
			    ],
			    "record_file": {
			        "head": "AAAABQAAAAAAAAALAAAAAAAAAAE=",
			        "start_running_hash_object": "9CLag6JRdB4AAAABWP+BGwAAADDm/qSgvkEE1fJYb23POVf2y2QKlgIqvYk4bUn79hPXO57ew0CslCaDpHaq6DkmJ5k=",
			        "hashes_before": [
			            "Eejlxvd57aJpRkXVw9zsm3gdz+OGeu9o6HGPN4q5r4h3qCF5SQfJvU/BKGQsYoKb",
			            "/BikXfkQYMw1jRaH4KHHt23BeCmtiFmlbgYhxm3rBf9coe34PgBDo2ljbrMapD+2",
			            "hhP5dL/6OkKxeh0N65M8BAE2EQJuA67XkwoTLIhSHYYNcvyGPh4AFRq6sFTKMZ23",
			            "pnbgaV9xLHDfrQwwU6oboBP0NWz+r4XSlfC8ALzdg02viDlqr6cVvd89DkzpGbpK"
			        ],
			        "record_stream_object": "",
			        "hashes_after": [],
			        "end_running_hash_object": "9CLag6JRdB4AAAABWP+BGwAAADCleunR2RUQHDFGNMUnmkUedVqJ0Uhcs0m3+Yn1wrRmT3qvu7yhL7j7ZNyOxdMnSbU="
			    },
			    "signature_files": {
			        "0.0.4": "",
			        "0.0.3": "",
			        "0.0.6": "",
			        "0.0.5": ""
			    },
			    "version": 5
		}`)

	scheduled := []byte(
		`{
			    "address_books": [
			        ""
			    ],
			    "record_file": {
			        "head": "AAAABQAAAAAAAAALAAAAAAAAAAE=",
			        "start_running_hash_object": "9CLag6JRdB4AAAABWP+BGwAAADCleunR2RUQHDFGNMUnmkUedVqJ0Uhcs0m3+Yn1wrRmT3qvu7yhL7j7ZNyOxdMnSbU=",
			        "hashes_before": [
			            "SE6HLDoy3er/zTGW0hky79wtr8dwnie92Ef/ga8AKHgtbYO2CHb1GpaaQZ101s5F",
			            "mx7pT5Cpdy5FtlYhZw5MCPvQF7coQGpBXsFpaEKuwGtTdaqXr6aPSCZKsHV/zD5V"
			        ],
			        "record_stream_object": "",
			        "hashes_after": [],
			        "end_running_hash_object": "9CLag6JRdB4AAAABWP+BGwAAADBLBbfQr8c5kr/Bf8fSQxWPGSRvDpVgFvh+XiaZ4UZWnCkW0bM+ztjQxFTKcdI63g8="
			    },
			    "signature_files": {
			        "0.0.4": "",
			        "0.0.3": "",
			        "0.0.6": "",
			        "0.0.5": ""
			    },
			    "version": 5
		}`)

	txId := "0.0.2153-1617188296-836585000"

	originalVerified, err := stateproof.Verify(txId, original)
	if err != nil {
		panic(err)
	}
	fmt.Println(originalVerified)

	scheduledVerified, err := stateproof.VerifyScheduled(txId, scheduled)
	if err != nil {
		panic(err)
	}
	fmt.Println(scheduledVerified)

}
